sap.zen.crosstab.BaseArea.prototype.openContainerCell=function(r,c){r.write("<td");r.addStyle("border-spacing","0px");r.addStyle("padding","0px");r.addStyle("border-width","0px");r.addStyle("margin","0px");r.writeStyles();if(c){r.writeAttribute("class",c);}r.write(">");};
sap.zen.crosstab.BaseArea.prototype.closeContainerCell=function(r){r.write("</td>");};
sap.zen.crosstab.BaseArea.prototype.openContainerTable=function(r){r.write("<table");r.writeAttribute("id",this.sId+"_container");r.addStyle("border-collapse","collapse");r.addStyle("border-spacing","0px");r.addStyle("padding","0px");r.addStyle("border-width","0px");r.addStyle("margin","0px");r.writeStyles();r.write(">");};
sap.zen.crosstab.BaseArea.prototype.closeContainerTable=function(r){r.write("</table>");};
sap.zen.crosstab.BaseArea.prototype.renderContainerStructure=function(r,s,v,h){this.openContainerTable(r);r.write("<tr>");this.openContainerCell(r);r.write("<table");r.writeAttribute("id",this.sId);r.writeAttribute("class",s);r.write(">");r.write("</table>");this.closeContainerCell(r);if(h){this.openContainerCell(r,"sapzencrosstab-HorizontalCutOff-"+this.getAreaType());r.write("<div");r.writeAttribute("class","sapzencrosstab-HorizontalCutOffSpacer");r.write(">");r.write("</div>");this.closeContainerCell(r);}r.write("</tr>");if(v){r.write("<tr>");this.openContainerCell(r,"sapzencrosstab-VerticalCutOff-"+this.getAreaType());r.write("<div");r.writeAttribute("class","sapzencrosstab-VerticalCutOffSpacer");r.write(">");r.write("</div>");this.closeContainerCell(r);if(h){this.openContainerCell(r,"sapzencrosstab-CutOffCorner");this.closeContainerCell(r);}r.write("</tr>");}this.closeContainerTable(r);};
sap.zen.crosstab.BaseArea.prototype.columnHasSymbolException=function(c){this.oColsWithSymbolException[c]=null;};
sap.zen.crosstab.BaseArea.prototype.setColUserWidth=function(c,w,i){this.oColUserWidth[c]={"width":w,"ignore":i};};
sap.zen.crosstab.BaseArea.prototype.clearColUserWidth=function(c){delete this.oColUserWidth[c];};
sap.zen.crosstab.BaseArea.prototype.hasUserColWidths=function(){var h=this.oColUserWidth&&sap.zen.crosstab.utils.Utils.hasEntries(this.oColUserWidth);return h;};
sap.zen.crosstab.BaseArea.prototype.isFixedColWidthSet=function(c){if(!this.hasUserColWidths()&&!sap.zen.crosstab.utils.Utils.hasEntries(this.oUserResizedCols)){return false;}if(this.oColUserWidth[c]!==undefined){return true;}if(this.oUserResizedCols[c]!==undefined){return true;}return false;};
sap.zen.crosstab.BaseArea.prototype.setColGranularityCalculatedAndMeasured=function(c){this.bColGranularityCalculatedAndMeasured=c;};
sap.zen.crosstab.BaseArea.prototype.setUserResizedCol=function(c){this.oUserResizedCols[c]=true;};
sap.zen.crosstab.BaseArea.prototype.clearUserResizedCol=function(c){delete this.oUserResizedCols[c];};
sap.zen.crosstab.BaseArea.prototype.getCellsWithLineBreakTexts=function(){return this.oCellsWithLineBreakTexts;};
